import React, { Component } from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar'

class App extends Component {

  constructor(props) {
    super(props);
    this.changeWord = this.changeWord.bind(this)
  }

  state = {
    currentPage: null,
    word: "Test"
  }

  changeWord = () => {

    this.setState({
      word: "Minor Success!"
    })

  }


  render() {
    return (
      <div>
        <h1>ryan slevin</h1>
        <NavBar onClick={this.changeWord}/>
        <p>{this.state.word}</p>
      </div>
    );

  }

}

export default App;
